import { Formik, Form, Field, ErrorMessage } from "formik";

function MaterialForm() {
  return (
    <div>
      <Formik
        initialValues={{ title: "", link: "" }}
        onSubmit={(value, action) => {
          console.log(value);
          action.resetForm();
        }}
      >
        <Form>
          <label htmlFor="1">
            Write text
            <Field htmlFor="1" type="text" name="title" placeholder="title" />
          </label>
          <br />
          <label htmlFor="2">
            Write text
            <Field htmlFor="2" type="text" name="link" placeholder="link" />
          </label>
          <br />
          <button type="submit">Add material</button>
        </Form>
      </Formik>
    </div>
  );
}

export { MaterialForm };
